import React, { Component } from 'react';
import logo from './assets/logo.png';
import Container from '@material-ui/core/Container';
import './App.css';

class App extends Component {
  constructor(props) {
    super(props)
    this.state = {
      usdData: [],
      gbpData: [],
      eurData: [],
      CurrentRate: 'Price',
      currentPrice: '',
    };
    this._counter = this._counter.bind(this);
  }

  render() {

    return (
      <section className="main">
        <header className="content">
          <Container fixed>
            <div className="head">
              <img src={logo} className="logo" alt="logo" />
            </div>
          </Container>
        </header>
      </section>
    )
  }
}


export default App;
